import React from 'react';

const Banner = (props) => {
	return (
		<div>
			<p>Hello there, here's a number... {Math.round(Math.random()*5)}</p>
			<div id='banner' title='"The Harvesters" by Peter Bruegel, 1565 (Met Museum)'></div>
		</div>
	);
}

export default Banner;
